(1, 'banner_1651226790.jpg', 'image_one_1698996537.png', 'image_two_1698996537.png', 'image_three_1660151604.mp4', 'image_four_1698996537.png', '<p style=\"text-align:justify\">Park Ocean, Jaipur, located in the heart of the city, is a short distance away from Sikar Road, Jaipur . The hotel is easily accessible from the railway station (2.50 kms) and the Ajmer-Delhi National Highway (3 kms). It is in close proximity to major tourist attractions like Jantar Mantar, Hawa Mahal, City Palace and the walled city of Jaipur.<br />\r\nThe plush and spacious interiors at Park Ocean, Jaipur, Jaipur take the zing up a notch. Park Ocean, Jaipur chain of upscale business and leisure hotels elevates the Park Ocean experience while retaining the same freshness, quirkiness and energy that park Ocean is well known for. Park Ocean pampers the style conscious and upbeat traveler with its personalized services, premium in-room amenities, award winning restaurants and fun experiences.<br />\r\nThe hotel with its 48 smartly furnished rooms and suites, offers you a wide array of accommodation options. Room categories include several Club Room, Deluxe Room, Super Deluxe Room. The hotel offers an roof top pan-Asian restaurant &ndash; Republic of Noodles, a hip recreation bar &ndash; Slounge, a 24x7 multi-cuisine coffee shop &ndash; five senses restro lounge, business center, a 2200 sq. ft. of conference area, the rejuvenating spa &ndash; Fresco, a rooftop swimming pool to keep you feeling fresh.</p>', NULL, NULL, NULL, NULL, NULL, NULL, '2022-04-27 06:22:23', '2023-11-03 14:28:57');
