(3, 'image_1651237234.jpg', 'imagetwo_1660286834.png', 'IPL Jaipur 2019: Schedule, Date, Timings, and Upcoming Matches', '<p>The Pink City is down with IPL fever once again and the enthusiasm can equally be seen flowing all over the country. The Indian Premier League kicked off its 12th edition on March 23 and is going to be different from the previous editions as fresh-look teams and new players lock horns for the coveted title.</p>\r\n\r\n<p>SMS stadium is known for hosting Rajasthan Royals matches with other Indian Premier League. This time total of seven matches will be played at Sawai Man Singh Stadium in the 12th edition of T20&rsquo;s league.</p>\r\n\r\n<p>The schedule for this year has been delayed because the IPL and Lok Sabha elections will be held around at the same time. So, the first two-week schedule has been released for the first round.</p>\r\n\r\n<p>Here are all the details for matches going to be held in Jaipur:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Date: 25 March 2019</strong></p>\r\n\r\n<p>Day: Monday<br />\r\nMatch Details: Rajasthan Royals vs Kings XI Punjab<br />\r\nVenue: SMS Stadium<br />\r\nTime: 20:00 IST</p>\r\n\r\n<p><strong>Date: 2 April 2019</strong></p>\r\n\r\n<p>Day: Tuesday<br />\r\nMatch Details: Rajasthan Royals vs Royal Challengers Bangalore<br />\r\nVenue: SMS Stadium<br />\r\nTime: 20:00 IST</p>\r\n\r\n<p><strong>Date: 7 April 2019</strong></p>\r\n\r\n<p>Day: Sunday<br />\r\nMatch Details: Rajasthan Royals vs Kolkata Knight Riders<br />\r\nVenue: SMS Stadium<br />\r\nTime: 20:00 IST</p>\r\n\r\n<p><strong>Date: 11 April 2019</strong></p>\r\n\r\n<p>Day: Thursday<br />\r\nMatch Details: Rajasthan Royals vs Chennai Super Kings<br />\r\nVenue: SMS Stadium<br />\r\nTime: 20:00 IST</p>\r\n\r\n<p><strong>Date: 20 April 2019</strong></p>\r\n\r\n<p>Day: Saturday<br />\r\nMatch Details: Rajasthan Royals vs Mumbai Indians<br />\r\nVenue: SMS Stadium<br />\r\nTime: 16:00 IST</p>\r\n\r\n<p><strong>Date: 22 April 2019</strong></p>\r\n\r\n<p>Day: Monday<br />\r\nMatch Details: Rajasthan Royals vs Delhi Capitals<br />\r\nVenue: SMS Stadium<br />\r\nTime: 20:00 IST</p>\r\n\r\n<p><strong>Date: 27 April 2019</strong></p>\r\n\r\n<p>Day: Saturday<br />\r\nMatch Details: Rajasthan Royals vs Sunrisers Hyderabad<br />\r\nVenue: SMS Stadium<br />\r\nTime: 20:00 IST</p>\r\n\r\n<p>Save the dates in your calendar to not miss on a single match!</p>\r\n\r\n<p>If you are not a local and particularly visiting Pink City to watch IPL matches then, you can book your stay in advance at&nbsp;<a href=\"http://www.hotelparkocean.com/\" target=\"_blank\">hotels with restaurant in Jaipur</a>&nbsp;covering all the necessary facilities and services including free Wi-Fi and parking, luxury spa, complimentary breakfast, etc.</p>', '<p>&nbsp;</p>\r\n\r\n<p>A lot of times it has been observed that the people who want to find out information are embarrassed by being caught as the high profile people are quite vulnerable to getting noticed in public places. Also the professionalism and techniques that we use will never give out any one even a slightest clue that they are being watched. Needless to say, confidentiality is maintained throughout the investigation. You will receive a detailed and legally accepted analysis or any kind of information and proof that you wanted from the case.</p>', '26', 'Mar', '2019', '0', '2022-04-18 00:06:16', '2022-08-12 13:57:37'),
(4, 'image_1651575356.jpg', 'imagetwo_1660287042.png', 'All The Details About Phalgun Khatu Shyam Ji Fair', '<p>The famous temple of Khatu Shyam Ji is located in the Khatu village of Sikar, Rajasthan. An immense faith in Khatu Shyam Ji attracts devotees from across the country to visit this holy place to offer prayers and seek blessings of Khatu. This temple is also popular for one of the biggest fairs of India, held on the occasion of Holi every year.</p>\r\n\r\n<h3>History of the Khatushyam Temple</h3>\r\n\r\n<p>It was built in 1027 AD by Roop Singh Chauhan, the then King of Khatu. The place where the idol was dug out from is known as Shyam Kund. Around 1720 AD, a nobleman named Abhai Singh refurbished the old temple, at the request of the then ruler of Marwar. The idol is made with the aid of rare stone.</p>\r\n\r\n<h3>The story of Khatu Shyam Ji Temple</h3>\r\n\r\n<p>Khatu Shyam Ji Temple is named after a warrior, Veer Barbarik whose last wish was to see the Mahabharata battle so Lord Krishna placed his own head on the mountain top for Baba to view the war. When the Kalyug era started, the head was found buried in Khatu &ndash; a village situated in Rajasthan. Then surprisingly, one day milk started flowing out of a cow&#39;s udder when she was near the spot. Post this incident, the villagers dug the place up and only the head was found.</p>\r\n\r\n<p>Later on, the head was handed over to a Brahmin. King of Khatu &ndash; Roop Singh Chauhan has a dream where he was urged to build a temple and place the head therein. Upon King&rsquo;s order, a Khatu Shyam Ji temple was built and the idol was installed on the 11th day of the Shukla Paksha of Phalgun month.</p>\r\n\r\n<h3>About the Phalgun Khatu Shyam Fair</h3>\r\n\r\n<p>Amongst the biggest fairs of the Hindu temples of India, Khatu Shyam Ji Fair is one. Lakki Mela takes place every year and is a centre of attraction amongst people. The fair usually lasts for five days but keeping a large number of devotees in mind, this year&rsquo;s fair has been increased to ten to twelve days.</p>\r\n\r\n<p>This time, the religious fair will take place from 10 March 2019 and continue till 19 March 2019. The main fest will be held on 17th March on the day of Ekadashi in Phalgun month. In place of Shyam Baba&#39;s Kirtan, Shyam devotees make a tremendous effort to feed the devotee, Baba.</p>\r\n\r\n<p>Visitors from all over India have immense faith in God and which is why the temple witnesses devotees in large numbers every year. Millions of devotees make marks by travelling from the rings to the Khatu Dham, with the marks of Kesariya colour.</p>\r\n\r\n<p>Due to the popularity of the fair, there is a heavy crowd seen and people have to stand in the long queues of worshippers. After a tiring day, you would surely require a comfortable place to stay and during the peak season, it would be difficult to find good accommodation in the good hotels. Hence, book the&nbsp;best hotel in Jaipur to stay&nbsp;as Jaipur is hardly 79 Kilometers away from the shrine temple.</p>', '<p>Approximately 70% of individuals in the globe are involved in love affairs. Regardless can be upsetting to learn that your spouse is in a relationship. The most widely used investigation service to answer inquiries and determine the dependability of your assistance is a loyalty test inquiry. A loyalty test investigation is the most common way to answer queries about your relationship and determine whether or not your partner has altered their allegiance to you.</p>', '12', 'Mar', '2019', '6', '2022-04-18 00:48:09', '2022-08-12 13:58:03'),
(5, 'image_1651575587.jpg', 'imagetwo_1660287130.png', 'Famous Shiva Temples in Jaipur to Visit on Maha Shivaratri', '<p>Maha Shivratri is one of the biggest festivals in India and is observed in the honour of Lord Shiva. One of the reasons to celebrate this day is that the formless God, Sadashiv appeared in the form of &quot;LingodbhavMoorti&quot; during midnight on MahaShivratri. Hence, all Mahadeva devotees keep vigil at night of this festival and perform &quot;Shivlingamabhishekham&quot; at midnight.</p>\r\n\r\n<p>It is also regarded as a new day for Sadhak for spiritual growth and material accomplishment. The holy festival starts by Rudrabhishek (including ghee, dhoop, milk, water, BeelPatra, Agarbatti, flowers)in temples and almost everyone offers prayers in the morning and evening and some even observe fast throughout the day.</p>\r\n\r\n<p>Jaipur is one of the most beautiful and cultural cities of India because of the rich legacy and traditions, and famous religious temples. Here festivals are celebrated with a lot of enthusiasm and most of them have religious significance like MahaShivratri, and attracts a large number of tourists on this auspicious day.</p>\r\n\r\n<p>Feel the essence of spiritualism with the holy visit to various Shiva temples of Pink City:</p>\r\n\r\n<p><strong>1. Eklingeshwar Temple</strong></p>\r\n\r\n<p>This temple is located on the JLN route behind the Moti Dungari and Birla Mandir. Mahadeva disciples wait for the complete year to worship in this temple. Sources reveal that the statue of Lord Parvati and God Ganesha with Lord Shiva was established, but the icons disappeared, after that, once again the idols were placed but became extinct automatically. Henceforth, nobody dared to set up any statue beside Bhagwan Shankar in the temple.</p>\r\n\r\n<p><strong>2. Tarkeshwar Temple</strong></p>\r\n\r\n<p>This is a temple particularly dedicated to Lord Shiva, located in Chaura Rasta of Jaipur and is said to be built around 1784. Being the old and famous one, it has a hundred thousands of followers and visitors per day. The statue of Shivling is made in a 9&rdquo; diameter bearing typical black colour.</p>\r\n\r\n<p><strong>3. Jharkhand Mahadev Temple</strong></p>\r\n\r\n<p>This famous Shiva building started constructing in 1916 in South &ndash; Indian style, which is why the temple is very old. Earlier, it was located between the farms but is now situated in one of the posh localities of Jaipur. Nandi&rsquo;s statue was constructed around 2006.</p>\r\n\r\n<p><strong>4. Ambikeshwar Mahadev Temple</strong></p>\r\n\r\n<p>This temple is located in Amber Fort of Jaipur. The floor area of the temple is at least 6 feet below the level of road and was constructed by Ambika King. It is decorated with a prominent Shikhar. Other than this, this holy place is constructed in Nagara style of temple architecture. This temple is believed to be 5000 years old or more than that.</p>\r\n\r\n<p>After standing in the long queues of devotees, you will surely need the&nbsp;<a href=\"http://www.hotelparkocean.com/\" target=\"_blank\">best hotel in Jaipur to stay</a>, with all the good facilities near above - mentioned temples. So, it is best to book the hotel in advance to avoid last minute rush.</p>', '<p>They will provide you with several proofs and passively observe their behavior in order to unearth the facts and find what your accomplice is doing. Our professional detectives are intelligent and can quickly deduce information about your significant other and any questionable behavior. They can also put them to the test, depending on your preferences. These administrations have been much improved and are now in accordance with our customers&rsquo; requirements. They also provide a comprehensive investigation report. To give complete documentation to our client base &amp; re-establish their connection, we also included picture verification. They are your ally in distress and assist in cementing your bond with your partner.