(9, 'image_1651577371.jpg', 'imagetwo_1660287227.png', 'Interesting Stories About The Haunted Bhangarh Fort', '<p>India is a mystical country with various haunted forts and monuments. One such ghastly castle of India is Bhangarh fort, located on the border of the Sariska Reserve in the Aravalli range of hills in Alwar district and was built in the 17th century by Man Singh for his younger son Madho Singh.</p>\r\n\r\n<p>Its premises are surrounded by a partly ruined wall, gardens, banyan trees, haveli and temples of Lord Gopinath, Someshwar, Mangla Devi, and Keshava Rai. But the mysterious attraction is an isolated chhatri on the hilltop which attracts the attention of travellers. Even the Archaeological Survey of India(ASI)has requested the locals and tourists to not enter the fort during evening or night time. There is no one particular story behind why the fort is haunted.</p>\r\n\r\n<p>Here are two interesting stories about this place:</p>\r\n\r\n<h3><strong>1. The Story of Princess Ratnavati and Singhia Tale</strong></h3>\r\n\r\n<p>The wicked sorcerer Singhia was attracted by Ratnavati&rsquo;s beauty and tried to trap her in his magical ploy, but failed every time as the princess too was a master in tantric art. One day he saw the beauty buying oil for the palace and spelt black words that anyone who touched the oil would turn into a stone. Queen came to know his intentions, thus dropped the oil on the magician and soon after that he turned into a stone, but before the death, the magician cursed the whole city saying that no soul would ever live in peace and no house would ever stand erect.</p>\r\n\r\n<h3><strong>2. The Prophecy of the Ascetic</strong></h3>\r\n\r\n<p>It is believed that Madho Singh took permission from an ascetic Guru Balu Nath who lived near the neighbourhood to construct the fort. He gave the permission on a clause that the shadow of the fort should never fall ahead his home and the king accepted his condition. Thereafter, the king started raising the structures vertically, but could not stop the shadow to fall and the result of it was that the fort doomed in no time.</p>\r\n\r\n<p>Apart from this, there are two interesting beliefs related to the castle:</p>\r\n\r\n<p><strong>Doors Close After Dusk</strong></p>\r\n\r\n<p>Yes, the doors of the fort are closed after sunset. A major incident was reported where two boys spent a night in the fortress but never returned. Thus, strict rules have been made to leave the area before dusk. Even the entrance gate is closed till late morning for security reasons.</p>\r\n\r\n<p><strong>Roofless Top</strong></p>\r\n\r\n<p>It might be shocking to hear but people living nearby claim that whenever they try building a roof, it immediately collapses. Thus, people here do not have a rooftop in their homes.</p>\r\n\r\n<p>So, if you are planning to visit this place anytime soon, then you can book your stay in&nbsp;<a href=\"http://www.hotelparkocean.com/\">hotels near Jhotwara road Jaipur</a>&nbsp;and plan a road trip to Bhangarh Fort, located about 85 kms from Jaipur, easily coverable within a day!</p>', NULL, '27', 'Feb', '2019', '0', '2022-05-03 05:59:31', '2022-08-12 13:53:47'),
(10, 'image_1651577461.jpg', 'imagetwo_1660287305.png', 'Hotels in Jaipur: Delivering a Comfortable Lifestyle', '<p>Jaipur attracts visitors for its glorious palaces, havelies, hilltop forts, and burgeoning gardens. Royal City welcomes countless people from various parts of the world every now and then.</p>\r\n\r\n<p>Jaipur Hotels with its excellent and skilled level of service has won the hearts of visitors coming from different sections of the world. Apart from this, the prime locations of the hotels are accessible from the place of commuting without any trouble. Whatever is the reason for your trip, you will get a wide range of sophisticated options to accommodate in the Pink City.</p>\r\n\r\n<p>Jaipur hotels are quite popular among people because one can easily locate the number of three-star, four and five-star hotels, budget and deluxe accommodations, heritage, and guesthouses offering contented accommodation to both domestic and international travellers.</p>\r\n\r\n<p>Each varies from each other in terms of facilities and charges. The packages offered by each of them give a huge choice to travellers for accommodation.</p>\r\n\r\n<p>Here are the top 5 accommodation types:</p>\r\n\r\n<p><strong>1. Heritage Hotels</strong></p>\r\n\r\n<p>There are various heritage hotels in Pink City but the Rambagh Palace is popular amongst tourists. It was built in 1835. The beautiful gardens of the hotel are amongst the most alluring gardens in the world because of the interesting and charming greenery. Travellers can get a glimpse of different varieties of flowers in this heritage hotel. It has a separate restaurant named The Rajput Room offering the appetizing range of continental and Indian cuisines.</p>\r\n\r\n<p><strong>2. Four Star Hotels</strong></p>\r\n\r\n<p>Royal Orchid is a well-known 4-star hotel in Jaipur. The hotel is located at a distance of 14 km from the airport and has 70 well decorated appealing rooms. Apart from this, it also has a coffee shop cum restaurant offering varieties of Indian delicacies. Its conference room is popular amongst business folks for holding corporate meetings. Besides, it has a theatre style hall with a seating capacity for 40 people.</p>\r\n\r\n<p><strong>3. Deluxe Hotels</strong></p>\r\n\r\n<p>Amongst the deluxe hotels in Jaipur, The Comfort Inn Hawa Mahal is a popular one. It is located at a distance of 11 km from the city&rsquo;s airport and just 1 km from the railway junction. 39 deluxe rooms are available for accommodation and an extra bed facility is also provided to the guests. The hotel rooms have a 24 x 7 internet connection, telephone and room service availability is provided to the customers with hot and cold running water in bathrooms. Nearby to the hotel is&nbsp;a famous bar named Scarlet at Hawa Mahal that is popularly known for serving a fine collection of liquor and wine in a peaceful ambience.</p>\r\n\r\n<p><strong>4. Luxury Hotels</strong></p>\r\n\r\n<p>The Oberoi Raj Vilas is a hotel that would make you indulge into sheer lavishness. It belongs to the renowned Oberoi Group and features a grand complex that consists of luxurious tents, comfy rooms and beguiling villas with pools exhibiting the pictures of the bygone era Rajput kings. Its signature cuisine restaurant is Surya Mahal that serves a variety of delectable cuisines.</p>\r\n\r\n<p><strong>5. Budget Hotels</strong></p>\r\n\r\n<p>Hotel Park Ocean is a famous&nbsp;budget hotel on Sikar road&nbsp;providing all the necessary facilities and services one would require. Rooms are equipped with air-conditioners, television, and comfortable beds. Besides, it has a spacious lounge, parking area, free Wi-Fi connection, and car rental facility. This budget hotel has reasonable and attractive packages for families, single occupants and also for peer groups.</p>\r\n\r\n<p>So, if you are planning to spend your holidays in a royal way, you can book your stay at one of the accommodation types in Jaipur.</p>', NULL, '22', 'Feb', '2019', '0', '2022-05-03 06:01:01', '2022-08-12 13:55:05'),
(11, NULL, 'imagetwo_1660287423.png', 'Here’s How Couples Can Celebrate The Day of Love in Jaipur?', '<p>Steeped in architecture, history and folklore, the city of pink hues and love- Jaipur has been marked as one of the most visited cities across the globe. Its exotic landscape, vibrant aura and beauty inspire love, which has even made it a favourite destination for couples. From the old world charm to new world vibrancy, the city has a lot of places that help you to spend quality time with your loved ones in a number of exciting ways.</p>\r\n\r\n<p>As the month of February has already commenced and soon the day dedicated to love will approach, people will confess their feelings to their partners, exchange gifts and promises to stay together forever.</p>\r\n\r\n<p>To add fun to the beauty of new beginnings, here&rsquo;s what couples can do to in Jaipur to spend this love week in their own unique way:</p>\r\n\r\n<p>&bull; To start with, couples can kick off the day with experiencing a serene sunrise at&nbsp;<strong>Jal Mahal</strong>&nbsp;followed by having delicious breakfast at&nbsp;<strong>Padao</strong>,&nbsp;<strong>Nahargarh Fort</strong>, which is known for offering a panoramic view of the city.</p>\r\n\r\n<p>&bull; For the next half of the day, couples could spend time together exploring the world-famous monuments in Jaipur, such as&nbsp;<strong>Albert Hall</strong>,&nbsp;<strong>Amer Fort</strong>&nbsp;or even&nbsp;<strong>Hawa Mahal</strong>. In fact, right in front of&nbsp;<strong>the Palace of Wind</strong>&nbsp;is a cosy eating joint called &ldquo;<strong>The Wind View Cafe</strong>&rdquo; that offers an aesthetic background for your photos here along with satiating your good food desires.</p>\r\n\r\n<p>&bull; When tired with the events of the day, spend a cosy evening at&nbsp;<strong>Hotel Park Ocean</strong>&nbsp;which is one of the&nbsp;<a href=\"http://www.hotelparkocean.com/\">best Hotels near Jhotwara Road Jaipur</a>. After relaxing for a while in the well-equipped rooms, head on to try some finger licking good cuisines at the rooftop&nbsp;<strong>pan-Asian restaurant &ndash; Republic of Noodles</strong>&nbsp;or slurp in some cocktails/mocktails at&nbsp;<strong>the hip recreation bar &ndash; Slounge</strong>.</p>\r\n\r\n<p>With this, mark an end to your flavorful day by staying the night with our 4-star rating hotel and making the most of your lavish and comfortable experience here.</p>', NULL, '12', 'Feb', '2019', '0', '2022-08-12 13:57:03', '2022-08-12 13:57:03');
