(5, 'Temperature Controls', 'Iron & Ironing Board on Demand', '24*7 Room Dining', 'Free Parking', 'Free Wifi', 'Buffet Breakfast', 'Roof Top Restro lounge', 'Spa & Pool', 'Luxury comfort', 'Meeting & Conference', '<p style=\"text-align:justify\">A stay at the Park Ocean means a good nights rest. With a selection of room types and layouts to choose from, the Park Ocean is your home away from home. All of our rooms come with 32 LCD TV, free Wi-Fi, a mini bar and a Tea-Coffee Maker.<br />\r\nIf you need complete, affordable accommodation for an extended stay with The Hotel Park Ocean.The Park Ocean is proud to offer several Club Room, Deluxe Room, Super Deluxe Room.</p>', 'welcome_image_166080796221212.jpg', 'WELCOME TO PARK OCEAN', '<h2 style=\"font-style:italic\">Experience the difference&hellip; Solution of yesterday&hellip; With every comfort of today&hellip;</h2>\r\n\r\n<h2 style=\"font-style:italic\"><span style=\"font-size:18px\">Park Ocean, Jaipur, located in the heart of the city, is a short distance away from Sikar Road, Jaipur . The hotel is easily accessible from the railway station (2.50 kms) and the Ajmer-Delhi National Highway (3 kms). It is in close proximity to major tourist attractions like Jantar Mantar, Hawa Mahal, City Palace and the walled city of Jaipur.</span></h2>', 'pro_16989254252.png', 'pro_16989254255.png', 'pro_1660817857pro_1660296913CLUB ROOM (2) (2).jpg', 'pro_16989254253.png', 'event_image_five1698926319New Project (7).jpg', 'event_image_six_16989872764.png', '<p style=\"text-align:justify\">We have 3 Banquet Venue/Hall which can cater from small gathering of 60 people to big social event of 200 plus people and a roof top for catering to 20-80 people. Our staffs are trained enough to bring smile on your face with their excellent service. If you are thinking of doing parties, small to big, The Park Ocean Hotel is ready to serve you at their best. Provide us the opportunity and feel the difference. We would love to make your day memorable by hosting your anniversary, birthdays, kitty parties, wedding functions and confidential meetings at exceptional service and highly affordable pricing. You can choose between any of the below mentioned outlets as per your suitability and everything else will be taken care by our team.</p>', 1, '2022-04-28 01:28:54', '2023-11-03 11:54:36');
