INSERT INTO `specialoffer` (`id`, `heading`, `content`, `created_at`, `updated_at`) VALUES
(1, 'Monsoon Offers', '<ul>\r\n	<li>Club or Deluxe Room on double occupancy basis</li>\r\n	<li>Non Alcoholic welcome drink on arrival</li>\r\n	<li>Meal as per plan Buffet / TDH at Five Senses restaurant on mix menu basis chef choice</li>\r\n	<li>Child below 5 years complimentary sharing with parents room, their bed &amp; meals.</li>\r\n	<li>For Long staying guest (more then 3 days) 15% special discount on food, soft beverages &amp; Laundry services.</li>\r\n	<li>In room 02 packed drinking water complimentary per room per day (500 ML)</li>\r\n	<li>Tea/coffee maker refilled twice a day complimentary in room.</li>\r\n	<li>Complimentary usage of Swimming Pool at roof top (operational hours only)</li>\r\n	<li>Complimentary Wi-Fi enabled in all staying floors, per room one coupon perday per person</li>\r\n	<li>In-room Mini bar (Tempreturecontrol), Safe Lockers &amp; Hair dryer</li>\r\n	<li>In-house Satellite Channels</li>\r\n	<li>Non Smoking rooms</li>\r\n	<li>Travel Desk, Doctor on Call, Valet Parking, Laundry service, Left luggage room,</li>\r\n	<li>Special Rajasthani folk dance/Puppet show,Spa treatments, live bar-beque &amp; Fire works (prior booking on chargeable basis),</li>\r\n	<li>&nbsp;</li>\r\n	<li>Local sight seeing with guide, evening light &amp; sound show (prior booking on chargeable basis),</li>\r\n	<li>GST &amp; Service Charges as applicable</li>\r\n</ul>\r\n\r\n<p>For booking &amp; any further details please contact:- Mob: +91- 95491-77755 / 96728-77755 / 96102-77755</p>\r\n\r\n<p>*Terms &amp; Condition Apply,<br />\r\n*Package valid Till Sep&rsquo; 2019 on prior booking basis.<br />\r\n*Above package will not be applicable during Festival days.</p>', '2022-05-04 00:07:51', '2022-08-18 18:58:57');
INSERT INTO `testimonails` (`id`, `name`, `content`, `created_at`, `updated_at`) VALUES
(2, 'Yash jain', '<p>Park ocean is one of the best hotels in Jaipur. As I stayed here for my official work, the place is just amazing.</p>', '2022-04-18 05:27:13', '2022-08-12 16:52:04'),
(3, 'Ayush parashar', '<p>Excellent service provided by hotel staff and their General Manager.</p>', '2022-04-18 05:32:09', '2022-08-12 16:51:54'),
(5, 'Rishit', '<p>An absolutely unhygienic hotel. Even their club rooms stank even after they had supposedly been prepped for accommodating new guests.</p>', '2022-04-28 02:05:27', '2022-08-12 16:53:48'),
(6, 'Shailendra Singh', '<p>Food quality rooms cleaning is also excellent. Dining area, cleaning &amp; staff also very careful &amp; friendly..</p>', '2022-04-28 02:05:53', '2022-08-12 16:57:00'),
(7, 'Deepak Jalvi', '<p>Hotel is the best. service of the staff is excellent.</p>', '2022-04-28 02:06:34', '2022-08-12 16:57:38'),
(8, 'Nizam', '<p>This is one of the best place to stay in Jaipur. &nbsp;</p>', '2022-04-28 02:07:31', '2022-08-12 16:58:46');
